void plot_pixel(int x, int y, short int line_color){
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}
void swap(int * a , int * b){
	int temp = *a;
	*a = *b;
	*b = temp;
}
void clear_screen(){
    int x , y;
	// draw every square as black
	for(x = 0; x < 320; x++){
		for(y = 0; y < 240; y++){
			plot_pixel(x, y, 0);
		}
	}
    return;
}

void draw_line(int x1, int y1, int x2, int y2, int colour){
	int steep = ABS(y2 - y1) > ABS(x2 - x1);
	
	// draw in the longer direction
	
	if (steep){
		swap(&x1 , &y1);
		swap(&x2 , &y2);
	}
	
	// always start from smaller x
	
	if (x1 > x2){
		swap(&x1 , &x2);
		swap(&y1 , &y2);
	}
	
	int deltax = x2 - x1;
	int deltay = ABS(y2 - y1);
	int error = -(deltax / 2);
	
	int y = y1;
	int y_step = -1;
	if (y1 < y2)
		y_step = 1;

	int x = x1;
	for (x ; x < x2; x++){
		if (steep)
			plot_pixel(y, x, colour);
		else
			plot_pixel(x, y, colour);
		
		error += deltay;
		
		if (error > 0){
			y += y_step;
			error -= deltax;
		}
	}
}

void clear_text_buffer(void){
    int x , y;
	for(x = 0; x < 80; x=x+4){
		for(y = 0; y < 60; y++){
			*(unsigned int *)(0xC9000000 + (y<<7)+x) = 0;
		}
	}
}

void clear_text_buffer_line(int x0, int y0){
    int i, j;
    for(i = x0; i < x0 + 90; i += 4){
		for(j = y0; j < y0 + 2; j++){
			*(unsigned int *)(0xC9000000 + (j<<7)+i) = 0;
		}
	}
}

