float randMultiplier(void){
    int chooseMultiplier = rand() % 101;
    float multiplier;

    //implement piecewise function
    if (chooseMultiplier > 40){
        multiplier = 4.2771 * pow(0.9841 , (float) chooseMultiplier);
        // function is less than 1 at 91
    }
    else{
        multiplier = 9.1474 * pow(0.9636 , (float) chooseMultiplier);
        // never less than 1
    }
    if (multiplier < 1){
        multiplier = 1;
    }
	printf("%f\n",roundf(multiplier*100)/100);
    return roundf(multiplier*100)/100;
}

//HARDWARE INTERRUPT CODE FOR BUTTONS BELOW
// --------------------------------------------------
/* Initialize the banked stack pointer register for IRQ mode */
/* Turn off interrupts in the ARM processor*/
void disable_A9_interrupts(void)
{
   int status = 0b11010011;
   asm("msr cpsr, %[ps]" : : [ps]"r"(status));
}
/* Initialize the banked stack pointer register for IRQ mode */
void set_A9_IRQ_stack(void){
    int stack, mode;
    stack = 0xFFFFFFFF - 7;; // top of A9 on-chip memory, aligned to 8 bytes
    /* change processor to IRQ mode with interrupts disabled */
    mode = 0b11010010;
    asm("msr cpsr, %[ps]" : : [ps] "r" (mode));
    /* set banked stack pointer */
    asm("mov sp, %[ps]" : : [ps] "r" (stack));
    /* go back to SVC mode before executing subroutine return! */
    mode = 0b11010011;
    asm("msr cpsr, %[ps]" : : [ps] "r" (mode));
}
/* Turn on interrupts in the ARM processor */
void enable_A9_interrupts(void){
    int status = 0b01010011;
    asm("msr cpsr, %[ps]" : : [ps]"r"(status));
}
