//ATTRIBUTE VECTOR TABLE

/* Define the IRQ exception handler */
void __attribute__ ((interrupt)) __cs3_isr_irq (void)
{
   // Read the ICCIAR from the CPU Interface in the GIC
   int interrupt_ID = *((int *) 0xFFFEC10C);
   if (interrupt_ID == 73)           // check if interrupt is from the KEYs
      pushbutton_ISR ();
   else
      while (1);                     // if unexpected, then stay here
   // Write to the End of Interrupt Register (ICCEOIR)
   *((int *) 0xFFFEC110) = interrupt_ID;
}

// Define the remaining exception handlers */
void __attribute__ ((interrupt)) __cs3_isr_undef (void){
    while (1);
}
void __attribute__ ((interrupt)) __cs3_isr_swi (void){
    while (1);
}
void __attribute__ ((interrupt)) __cs3_isr_pabort (void){
    while (1);
}
void __attribute__ ((interrupt)) __cs3_isr_dabort (void){
    while (1);
}
void __attribute__ ((interrupt)) __cs3_isr_fiq (void){
    while (1);
}

// --------------------------------------------------
//pushBUTTON INTERRUPT SERVICE REGISTER FUNCTION

extern volatile int key_pressed;

void pushbutton_ISR( void ) {
    volatile int * KEY_ptr = (int *) 0xFF200050;
    int press;
    press = *(KEY_ptr + 3); // read the pushbutton interrupt register
    *(KEY_ptr + 3) = press; // clear the interrupt

    //WHAT FUNCTION FOR EACH BUTTON PRESSED

    if(press & 0x1){ // KEY0     //PLAYER1 IN WITH WAGER
        if(inLoading){
           drawP1IN();
           P1IN = true;
        }
        if(inGraphics){
            if(P1IN){
                drawP1IN();
                P1IN = false;
				P1OUT = true;
                p1Multiplier = curMultiplier;
            }
        key_pressed = 0;
        }
    }
    else if(press & 0x2){ // KEY1                //P2 WAGER BUTTON
        if(P1IN && inLoading){
            int SW_Amount = ((*SW_ptr) & 0b111); //GET LAST 3 DIGITS
            if(SW_Amount == 0){
                p1Wager = 0.1*p1Balance;
            }
            else{
                float totalPercent = 0;
                totalPercent += (SW_Amount & 0b1)*16;
                totalPercent += ((SW_Amount >> 1) & 0b1)*34;
                totalPercent += ((SW_Amount >> 2) & 0b1)*50;

                p1Wager = p1Balance*totalPercent/100;
            }
            drawP1Wager();
        }

        key_pressed = 1;
    }
    else if(press & 0x4){ // KEY2                  //P2 IN WITH WAGER BUTTON
       if(inLoading){
           drawP2IN();
           P2IN = true;
        }
        if(inGraphics){
            if(P2IN){
                drawP2IN();
                P2IN = false;
				P2OUT = true;
                p2Multiplier = curMultiplier;
            }
        }
        key_pressed = 2;     
    }
    else{ // press & 0x8, which is KEY3               //P2 WAGER BUTTON
        if(P2IN && inLoading){
            int SW_Amount = ((*SW_ptr) & 0b1110000); //GET LAST 3 DIGITS //CHANGE THIS
            if(SW_Amount == 0){
                p2Wager = 0.1*p2Balance;
            }
            else{
                float totalPercent = 0;
                SW_Amount = (SW_Amount >> 4);
                totalPercent += (SW_Amount & 0b1)*16;
                totalPercent += ((SW_Amount >> 1) & 0b1)*34;
                totalPercent += ((SW_Amount >> 2) & 0b1)*50;

                p2Wager = p2Balance*totalPercent/100;
            }
            drawP2Wager();
        }
        key_pressed = 3;
    }
    return;
}

